//Fetch product type from another testcase
def targetTestStep = testRunner.testCase.testSuite.testCases["FetchProductType"].testSteps["ProductType"]


// Call the test runner and check if it can run the specified step
def runner = targetTestStep.run(testRunner, context)
def resp=targetTestStep.getPropertyValue("response") 
def holder = new XmlHolder(resp) 
def type = holder.getNodeValue("//*:result/item[1]/name")
//store access token value in testcase level
context.testCase.setPropertyValue("prodtype",type)
log.info type
//store it in testsuite
context.testCase.testSuite.setPropertyValue("prodtype",type) 
//Store it in a project 
context.testCase.testSuite.project.setPropertyValue("prodtype",type)

